    posts = fields.List(
        fields.Nested(
            post_schema.PostSchema(exclude=["discipline_code", "reg_student"])
        )
    )
    disciplines = fields.List(fields.Nested(discipline_schema.DisciplineSchema))

    @validates("email")
    def validate_email(self, value):
        ValidateProfessorEmail().validate(value)

    @validates("name")
